import { motion, useAnimation, AnimatePresence } from 'framer-motion';
import { useState } from 'react';

export const Example = () => {
  const [activeDemo, setActiveDemo] = useState(null);
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });
  const controls = useAnimation();

  const handleMouseMove = (e) => {
    const { currentTarget, clientX, clientY } = e;
    const { left, top } = currentTarget.getBoundingClientRect();
    setMousePosition({ x: clientX - left, y: clientY - top });
  };

  const demos = [
    {
      title: "Morphing Shapes",
      color: "bg-gradient-to-r from-purple-500 to-pink-500",
      content: (
        <div className="grid grid-cols-3 gap-3">
          {[...Array(9)].map((_, i) => (
            <motion.div
              key={i}
              className="aspect-square bg-white/20 rounded-lg"
              animate={{
                scale: [1, 1.2, 1],
                rotate: [0, 180, 360],
                borderRadius: ["20%", "50%", "20%"]
              }}
              transition={{
                duration: 2,
                repeat: Infinity,
                delay: i * 0.1,
              }}
              whileHover={{
                scale: 1.5,
                zIndex: 10,
                background: "rgba(255,255,255,0.4)",
              }}
            />
          ))}
        </div>
      )
    },
    {
      title: "Particle System",
      color: "bg-gradient-to-r from-blue-500 to-teal-500",
      content: (
        <div className="relative h-48">
          {[...Array(20)].map((_, i) => (
            <motion.div
              key={i}
              className="absolute w-2 h-2 bg-white/40 rounded-full"
              animate={{
                x: [0, Math.random() * 200 - 100],
                y: [0, Math.random() * 200 - 100],
                scale: [1, Math.random() + 0.5, 1],
                opacity: [0.4, 1, 0.4],
              }}
              transition={{
                duration: 2 + Math.random(),
                repeat: Infinity,
                repeatType: "reverse",
                delay: i * 0.1,
              }}
              style={{
                left: `${Math.random() * 100}%`,
                top: `${Math.random() * 100}%`,
              }}
            />
          ))}
        </div>
      )
    },
    {
      title: "Interactive Game",
      color: "bg-gradient-to-r from-orange-500 to-red-500",
      content: (
        <div className="relative h-48 bg-black/10 rounded-lg p-4">
          <motion.div
            className="w-16 h-16 bg-white/20 rounded-lg absolute cursor-grab"
            drag
            dragConstraints={{
              top: 0,
              left: 0,
              right: 280,
              bottom: 160
            }}
            whileDrag={{ 
              scale: 1.2,
              boxShadow: "0px 5px 15px rgba(0,0,0,0.3)",
              cursor: "grabbing"
            }}
          >
            <span className="flex h-full items-center justify-center text-sm text-white">
              Catch me!
            </span>
          </motion.div>
          {[...Array(3)].map((_, i) => (
            <motion.div
              key={i}
              className="absolute w-8 h-8 bg-white/10 rounded-full"
              animate={{
                x: [0, Math.random() * 280],
                y: [0, Math.random() * 160],
              }}
              transition={{
                duration: 2,
                repeat: Infinity,
                repeatType: "reverse",
                delay: i * 0.5,
              }}
            />
          ))}
        </div>
      )
    },
    {
      title: "Wave Effect",
      color: "bg-gradient-to-r from-green-500 to-yellow-500",
      content: (
        <div className="space-y-3">
          {[...Array(5)].map((_, i) => (
            <motion.div
              key={i}
              className="h-8 bg-white/20 rounded-lg"
              animate={{
                scaleX: [1, 1.1, 1],
                x: [-10, 10, -10],
              }}
              transition={{
                duration: 2,
                repeat: Infinity,
                delay: i * 0.2,
              }}
              whileHover={{
                scale: 1.05,
                backgroundColor: "rgba(255,255,255,0.4)",
              }}
            />
          ))}
        </div>
      )
    }
  ];

  return (
    <div className="flex flex-col items-center justify-center min-h-[600px] p-8">
      <div className="grid grid-cols-2 gap-4 mb-8 w-full max-w-2xl">
        {demos.map((demo, index) => (
          <motion.button
            key={index}
            className={`${demo.color} p-6 rounded-xl text-white font-bold text-lg relative overflow-hidden`}
            whileHover={{ 
              scale: 1.02,
              transition: { duration: 0.2 }
            }}
            whileTap={{ scale: 0.98 }}
            onClick={() => setActiveDemo(activeDemo === index ? null : index)}
            onMouseMove={handleMouseMove}
          >
            {/* Spotlight effect */}
            <motion.div
              className="absolute w-32 h-32 bg-white/20 rounded-full blur-xl pointer-events-none"
              animate={{
                x: mousePosition.x - 64,
                y: mousePosition.y - 64,
              }}
              transition={{ type: "spring", damping: 10 }}
            />
            <span className="relative z-10">{demo.title}</span>
          </motion.button>
        ))}
      </div>

      <AnimatePresence mode="wait">
        {activeDemo !== null && (
          <motion.div
            key={activeDemo}
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -20 }}
            className={`${demos[activeDemo].color} p-8 rounded-xl w-full max-w-2xl`}
          >
            {demos[activeDemo].content}
          </motion.div>
        )}
      </AnimatePresence>

      <motion.p
        className="text-gray-400 text-sm text-center mt-4"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ delay: 0.5 }}
      >
        Click each button to explore different animation styles!
      </motion.p>
    </div>
  );
};
